function App() {
  let bio = [
    {
      head: " this is card1",
      info: "this is card1 and im desiging",
    },
    {
      head: " this is card2",
      info: "this is card2 and im desiging",
    },
    {head: " this is card1",
      info: "this is card3 and im desiging",
    }
  ];
  return (
    <>
      <Card head="this is card1" info="this is card1 and im designing" />
      <Card />
      <Card />
    </>
  );
}
export default App;
